import React from "react";

const SelectSetup = (props) => {
  const { text, subText } = props;
  return (
    <div
      style={{
        border: "1px solid red",
      }}
    >
      <h5>{text}</h5>
      <span
        style={{
          width: "25%",
          display: "flex",
        }}
      >
        {subText}
      </span>
    </div>
  );
};

export default SelectSetup;
